$Filter = new \RecursiveCallbackFilterIterator($Directory, function ($current, $key, $iterator) {
  global $skip_dir;
  return ! ($current->isDir() && in_array($current->getFilename(), $skip_dir) );
});
$Iterator = new RecursiveIteratorIterator($Filter);
$objects = new RegexIterator($Iterator, '/^.+\.(php|sql|json|jpg|JPG|jpeg|JPEG|png|PNG|gif|GIF)$/i', RecursiveRegexIterator::GET_MATCH);

echo "<h1>Verify Contents</h1>\n".
	"<h2>Based on Release: 9.0.6</h2>\n";

$total = 0;
$matched = 0;
$changed = 0;
$unexpected = 0;
$missing = 0;
foreach($objects as $name => $object){
	if( basename($_SERVER["SCRIPT_NAME"]) == basename($name) )
		continue;
	if( ! in_array(basename($name), $ignore) && ! is_dir($name) ) {
		$total++;
		$name = str_replace("\\", "/", $name);
		if( isset($cache[$name]) ) {
			$cache2 = md5(preg_replace('/\r\n|\r|\n/', "\r\n", file_get_contents($name)));
			if( $cache[$name] == $cache2 ) {
				//echo "<p>OK - $name matches cache</p>\n";
				$matched++;
			} else {
				echo "<p>CHANGED - $name (checksum does not match)</p>\n";
				$changed++;
			}
			unset( $cache[$name] );
		} else {
			echo "<p>UNEXPECTED - $name (may be OBSOLETE, added by hacker, NOT IN 9.0.6)</p>\n";
			$unexpected++;
		}
	}
}

foreach( $cache as $name => $md5 ) {
	if( basename($_SERVER["SCRIPT_NAME"]) == basename($name) )
		continue;
	echo "<p>MISSING - $name (expected in 9.0.6)</p>\n";
	$missing++;
}

echo "<h2>$matched good, $changed changed, $unexpected unexpected, $missing missing</h2>\n";
}
